function TodoList({ todos }) {
	return (
		<ul>
			{todos.map((todo) => {
				return <li>{todo.text}</li>
			})}
		</ul>
	)
}
const mapStateToProps = (state) => {
	return {
		todos: state.todos,
	}
}
const mapDispatchToProps = (dispatch) => {
	return {}
}
const TodoListContainer = connect(mapStateToProps, mapDispatchToProps)(TodoList)

